import React from "react";
import logo from "../img/entur_logo.jpg";
import Select from "react-select";

class NavBar extends React.Component {

    handleChange = () => {
        var x = document.getElementById("logout");
        if (x.style.display === "none") {
            x.style.display = "block";
        } else {
            x.style.display = "none";
        }
    };

    handleSelect = () => {
        console.log('trykka');
    };

    returnOptions = () => {
        return this.props.user.map(item => (
          { label: item, value: item }
        ))
    };

    render() {
        return (
            <nav className="navBar">
                <div className="padding">
                    <a href="/"><img src={logo} width={140} height={60} alt="Entur" /></a>
                    <div className='login' id="login">
                        <Select onChange={this.handleSelect}
                                options={this.returnOptions()}
                        />
                        <p className="text-center text-white">{this.props.user[0]}</p>
                        <a href={this.props.logout}><h6 className="text-center text-white">LOGG UT</h6></a>
                    </div>
                </div>
            </nav>
        )
    }
}

export default NavBar;
